import React, { useState } from 'react';
import homeCard from './OOS';
import { motion } from 'framer-motion';

function App() {
  const {yes, no} = useState([])

 return (
    <div>
  <homeCard />
  <motion.h1 
  animate={{fontSize: 60, color: "#33333", x: 100, y: 10 }}
  transition={{ type:"spring", velocity: 120 }}  
   >
  OOS
  </motion.h1>
  <input type="text" />
  <button>yes</button>
   <button>No</button>
   </div>
   ,
   <div style={{width:100, height:100,  }}></div>
  )
}

export default App;
